  useEffect(() => {
    const script = document.createElement('script');
    script.async = true;
    script.src = '';
    document.head.appendChild(script);

    //스크립트 추가했으면 실행
    script.onload = () => {
      window.Kakao.maps.load(() => {
        const container = document.getElementById('map');
        const options = {
          center: new window.kakao.maps.LatLng(37.5665, 126, 978),
          level: 3,
        };
      });
    };
  });
  return (
    <div className='App'>
      <script></script>
    </div>
  );
}

export default App;
